private int referenceIndex;
@Nullable
private Reference<K, V> @Nullable [] references;
@Nullable
private Reference<K, V> reference;
@Nullable
private Entry<K, V> next;
@Nullable
private Entry<K, V> last;
public EntryIterator() {
    moveToNextSegment();
